import React from 'react';
// ./ 는 현재 파일이 있는 폴더 라는 뜻

function Food({ name, picture }) {
  //console.log(props); // console.log() 함수는 개발자 도구의 console 탭에만 영향을 주는 함수
  return (
    <div>
      <h2>I like {name} </h2>
      <img src={picture} alt={name} />
    </div>
  );
}

const foodILike = [
  {
    id: 1,
    name : 'Kimchi',
    image: 'data:image/jpeg;base64,',
  },
  {
    id: 2,
    name : 'Samgyeopsal',
    image: 'data:image/jpeg;base64,'
  },
  {
    id: 3,
    name: 'Bibimbap',
    image: 'data:image/jpeg;base64,',
  },
  {
    id: 4,
    name: 'Doncasu',
    image: 'data:image/jpeg;base64,',
  },
  {
    id: 5,
    name: 'Kimbap',
    image: 'data:image/jpeg;base64,',
  },
]; //foodILike 변수에 빈 배열을 저장함

// fav 는 favorite의 줄임말   즉, 좋아하는 음식 = "김치"
// 아래에서 props는 fav이고, fav에 kimchi라는 값을 담아서 Food 컴포넌트에 보냄
function App() {
  return ( 
    <div>
      {foodILike.map(dish => (
        <Food key={dish.id} name={dish.name} picture={dish.image} />))}
      
    </div>
  );
}

export default App;
